import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';


function Navbar() {
  return (
    <header>
        <nav className='navbar'>
            <Link to='/'>My Website</Link>
        </nav>

    </header>
  )
}

export default Navbar
